import React, { Component } from 'react'
import './Menu.scss'

export default class Menu extends Component {
  render() {
    return (
      <div className='Container__menu-wrapper'>
        <ul className='Container__menu-categories'>
          <li className='category'><a href="#">Culpa</a></li>
          <li className='category'><a href="#">Duis</a></li>
          <li className='category'><a href="#">In</a></li>
          <li className='category'><a href="#">Reprehenderit</a></li>
          <li className='category'><a href="#">Enim</a></li>
          <li className='category'><a href="#">Irure</a></li>
        </ul>
      </div>
    )
  }
}
